create table animalNames (
	id INT,
	name VARCHAR(50)
);


create table members (
	id INT,
	name VARCHAR(50),
	company VARCHAR(50),
	department VARCHAR(50),
	title VARCHAR(50),
	suffix VARCHAR(50)
);


create table test (
	id INT,
	username VARCHAR(50),
	info_updated DATETIME
);


create table customerData (
	id INT,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	gender VARCHAR(50)
);


create table groceries (
	id INT,
	grocery VARCHAR(50),
	vendor VARCHAR(50),
	qty INT,
	buy_price DECIMAL(4,2),
	sell_price DECIMAL(4,2)
);
